import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {

    const[filteredTestList, setFilteredTestList] = useState();

    useEffect(() => {
        const filterTestList = async () => {
            const testList = await client.entities.test.list();
            const temp = testList.filter(testList => testList.Device.includes('Device1'));
            //console.log(testList?.items);
            setFilteredTestList(temp);

        }
        filterTestList();
    }, [])


    return(
        
        <div className="DevicePage">
            <table>

                 <tr>
                    <th>Name</th>
                    <th>Address</th>
                    <th>Phone Number</th>
                    <th>Email</th>

                </tr>   

                <tbody>
                    <tr>
                        <td>1</td>
                        <td>2</td>
                        <td>3</td>
                        <td>4</td>

                    </tr>
                </tbody>
            </table>

        </div>

    )
}
